import * as React from "react";
import { Component } from "react";
import styles from "./../styles/episodeSelect.module.css";
import Image from "./basicComponents/image";

export interface EpisodeSelectProps {}

export interface EpisodeSelectState {}

class EpisodeSelect extends React.Component<
  EpisodeSelectProps,
  EpisodeSelectState
> {
  render() {
    return (
      <div className={styles.container}>
        <div className={styles.containerFlex}>
          <div className={styles.episodeSelect}>
            <div className={styles.episodeSelectText}>Серия№</div>
            <input
              className={styles.episodeSelectInput}
              type="number"
              min="0"
              max="23"
            />
          </div>
          <div className={styles.episodeText}>Серия:</div>
          <div className={styles.btns}>
            <div className={styles.btn}>1</div>
            <div className={styles.btn}>2</div>
            <div className={styles.btn}>3</div>
            <div className={styles.btn}>4</div>
            <div className={styles.btn}>5</div>
            <div className={styles.btn}>6</div>
            <div className={styles.btn}>7</div>
          </div>
          <div className={styles.changeBtn}>
            <Image
              width={"100%"}
              height={"100%"}
              mode="fill"
              src={require("./../" + "star_77949.svg")}
            />
          </div>
          <div className={styles.changeBtn}></div>
        </div>
      </div>
    );
  }
}

export default EpisodeSelect;
